class App extends Component {
	render() {
		return (
			<div className="App">
				<ParticleBackground />
				<Navigation />
				{/* <Title /> */}
				<Logo />
				<Rank />
				<ImageLinkForm />
				{/*<FaceRecognition/> */}
			</div>
		);
	}
}

export default App;
